he icon...","disable_grid":"Disable grid","disable_guides":"Disable guides","disable_ruler":"Disable ruler","download_free_title":"Your free logo will be sent by email","download_logo":"Download my logo","duplicate":"Duplicate","edit":"Edit","editor_icon_edit":"Edit icon","edit_font":"Edit font","edit_font_selected":"Your font","edit_font_style":"Choose fonts style","edit_text":"Edit text","email_address":"Email address","enable_grid":"Enable grid","enable_guides":"Enable guides","enable_ruler":"Enable ruler","error_email_invalid":"Invalid email","error_email_used":"This email address is already linked to an account. Please log in to continue.","error_invalid_credentials":"Invalid email or password","error_invalid_data":"The data entered is invalid","error_password_match":"Passwords must match","error_required":"Required","error_unexpected":"Unexpected error","error_unexpected_title":"Something didn't work correctly","faq":"FAQ","faq_answer_1":"The FreeLogoDesign tool is very complete, you can edit the color, font size, font, modify the form of the logo, add icons, etc. The only real limitation is your imagination.","faq_answer_10":"To be able to provide you with an affordable experience, we try to avoid costly overheads such as call centers. Therefore, our support is through email and we are happy to receive your questions, so do not hesitate. Contact us by going on the <a href=\"https://www.freelogodesign.org/contact\" target=\"_blank\">contact page</a>.","faq_answer_11":"We accept payments by PayPal and credit card (Visa and MasterCard).","faq_answer_2":"Various sizes and formats are available. With the free version, the format is PNG 200x200 pixels (px). High resolution formats are: PNG 200x200px, PNG 500x500px, PNG 1000x1000px, PNG 5000x5000px, JPG 5000x5000px, PDF file and vector SVG.","faq_answer_3":"It depends on your needs. With the free version of your logo, you can very easily use it for your website, Facebook logo or an email signature. For a professiona
